style.css:
/* Reset default styles */
* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

/* Set body background and text color */
body {
    background-color: #000; /* Black background */
    color: #ddd; /* Light text */
    font-family: Arial, sans-serif;
    line-height: 1.6;
}

/* Set link colors */
a {
    color: #09f; /* Light blue for links */
}

a:hover {
    color: #06c; /* Lighter blue on hover */
}

/* Set headings color */
h1, h2, h3, h4, h5, h6 {
    color: #ccc; /* Lighter headings */
}

/* Set code block styles */
pre, code {
    background-color: #111; /* Darker background for code blocks */
    color: #ddd; /* Light text for code */
    padding: 10px;
    border-radius: 5px;
    overflow-x: auto;
}

/* Set blockquote styles */
blockquote {
    border-left: 5px solid #666; /* Darker border for blockquote */
    padding-left: 10px;
    color: #999; /* Lighter text for blockquote */
}

/* Set form input styles */
input[type="text"],
input[type="email"],
input[type="password"],
textarea {
    background-color: #111; /* Darker background for input fields */
    color: #ccc; /* Light text for input fields */
    border: 1px solid #444; /* Dark border for input fields */
    padding: 5px;
    border-radius: 3px;
}

/* Set button styles */
button {
    background-color: #222; /* Darker background for buttons */
    color: #ccc; /* Light text for buttons */
    border: 1px solid #444; /* Dark border for buttons */
    padding: 5px 10px;
    border-radius: 3px;
    cursor: pointer;
}

button:hover {
    background-color: #333; /* Darker background on hover */
}

/* Set table styles */
table {
    border-collapse: collapse;
    width: 100%;
}

th, td {
    border: 1px solid #444; /* Dark border for table cells */
}
